import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Button variant="contained" color="primary">
      Hello World
    </Button>
      </header>
    </div>
  );
}

export default App;
